import {NavLink} from 'react-router-dom';

const Header = (props) => {
  return (
    <header>
      <nav id="main-menu">
        <ul>
          <li>
            <NavLink to="/home">Home</NavLink>
          </li>
          <li>
            <NavLink to="/about">About</NavLink>
          </li>
          <li>
            <NavLink to="/shop">Shop</NavLink>
          </li>
          <li>
            <NavLink to="/help">Help</NavLink>
          </li>
          {/* <li><NavCartButton/></li> */}
        </ul>
      </nav>
    </header> 
  );
};

export default Header;
